DROP PROCEDURE IF EXISTS `daily_task_backup`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `daily_task_backup` ()  BEGIN 
	declare v_i int default 1;
        declare old_v_i int default 0;
	SELECT MIN(rowid) INTO @minId FROM storieshelper_map_column;
	SELECT MAX(rowid) INTO @maxId FROM storieshelper_map_column;
    set old_v_i = -1;
   	set v_i = @minId;
	while (v_i <= @maxId) DO
		SELECT tm.rowid, count(t.rowid), mc.name, mc.rank, mc.rowid INTO @fk_team, @nb_task, @column, @column_rank, @rowid
		FROM storieshelper_map_column mc
		INNER JOIN storieshelper_team tm on mc.fk_team = tm.rowid  
		INNER JOIN storieshelper_task t on t.fk_column = mc.rowid
		WHERE mc.rowid = v_i
		AND t.active <> 0;
        
        	IF (old_v_i != @rowid) THEN 
			VALUES (@fk_team, @nb_task, @column, @column_rank, NOW(), 'Day' );
	    	END IF;
            
		set old_v_i = v_i;
	    set v_i = v_i + 1;
	END WHILE;
END$$

